@cflw 正在完善DirectX游戏, 命名风格会与之前的[Python应用](https://zhuanlan.zhihu.com/p/51309019)类似

@htwx 详细介绍了Typescript 3.3 汉化的进展和遇到的问题(翻译后[命名冲突](https://github.com/program-in-chinese/CTS/issues/8))及可能解决方案(限制作用域, 限制语言语法等). 也参考酷q对今后的面向用户和应用类型(如各种小程序)进行了探讨. 提到第三方库的各种命名不规范带来的翻译问题. (必有遗漏, 还请补充)
个人建议早日将TS编译器源码分析的经验与汉化方式等等以文档形式加以小结, 会对有意参与的开发者有很大的参考价值, 也可以作为与其他有编译器开发修改经验的组员如 @swizl @absente 等的交流基础, 也可以对后续TS版本的更新提供具体指导. 另外, 建议尽量先将核心功能(编译器+核心库)稳定下来(包括各种开发文档), 再考虑第三方库的翻译问题.

qq@百度_CAD 旁听, 有qq发言, 期待更多交流

@nobodxbodon 打算在短期内集中[知识库](https://zhuanlan.zhihu.com/p/47807062)项目, 首先从最常用和基础的一些知识开始.
